db.patients.aggregate([
     {
       $project: {
         IMMUNIZATIONS: 1,
         _id: 0
       }
     },
     {
       $unwind: "$IMMUNIZATIONS"
     },
     {
       $match: {
         "IMMUNIZATIONS.DATE": { $exists: true },
         "IMMUNIZATIONS.CODE": 16150,
         "IMMUNIZATIONS.DESCRIPTION": "Influenza, seasonal, injectable, preservative free"
       }
     }
   ])

db.patients.aggregate([
     {
       $lookup: {
         from: "patients",
         localField: "encounters.ENCOUNTER_ID",
         foreignField: "_id",
         as: "encounter_careplans"
       }
     },
     {
       $unwind: "$encounter_careplans"
     },
     {
       $unwind: "$encounter_careplans.careplans"
     },
     {
       $match: {
         "encounter_careplans.careplans.DESCRIPTION": "Musculoskeletal care"
       }
     }
   ])

db.patients.aggregate([
     { $unwind: "$ENCOUNTERS" },
     { $unwind: "$ENCOUNTERS.MEDICATIONS" },
     { $match: {
         "ENCOUNTERS.MEDICATIONS.CODE": "NDA020800",
         "ENCOUNTERS.MEDICATIONS.DESCRIPTION": "0.3 ML Epinephrine 1 MG/ML Auto-Injector"
     }},
     { $project: {
         "_id": 0,
         "success": { $cond: { if: { $eq: ["$ENCOUNTERS.MEDICATIONS.REASON_CODE", 1] }, then: 1, else: 0 } }
     }},
     { $group: { _id: null, successRate: { $avg: "$success" } } }
 ])

db.patients.aggregate([
     {
       $unwind: "$encounters"
     },
     {
       $unwind: "$encounters.medications"
     },
     {
       $lookup: {
         from: "payers",
         localField: "encounters.payer_ref",
         foreignField: "PAYER_ID",
         as: "payer"
       }
     },
     {
       $unwind: "$payer"
     },
     {
       $match: {
         "payer.NAME": "NO_INSURANCE",
         "encounters.medications.payer_coverage": {
           $eq: 0
         }
       }
     },
     {
       $group: {
         _id: null,
         count: {
           $sum: 1
         }
       }
     }
   ])

db.CLAIMS.aggregate([
     {
       $unwind: "$CLAIM_TRANSACTIONS"
     },
     {
       $unwind: "$CLAIM_TRANSACTIONS.PROCEDURES"
     },
     {
       $match: {
         "CLAIM_TRANSACTIONS.PROCEDURES.DESCRIPTION": "Alendronic acid 10 MG Oral Tablet"
       }
     },
     {
       $group: {
         _id: "$PRIMARY_PATIENT_INSURANCE_REF",
         payer: { $first: "$PRIMARY_PATIENT_INSURANCE_REF" }
       }
     }
   ])

db.organizations.find({"NAME": "SERENITY HILL NURSING CENTER"}, {"_id": 0, "NAME": 0, "ADDRESS": 0, "CITY": 0, "STATE": 0, "ZIP": 0, "LAT": 0, "LON": 0, "PHONE": 0, "REVENUE": 0, "UTILIZATION": 0}).forEach(function(org) {
               db.providers.find({"ORGANIZATION_REF": org._id}, {"_id": 0, "PROVIDER_ID": 1, "NAME": 1}).forEach(printjson)
             })

db.patients.aggregate([
     {
       $unwind: "$ENCOUNTERS"
     },
     {
       $unwind: "$ENCOUNTERS.IMAGING_STUDIES"
     },
     {
       $match: {
         "ENCOUNTERS.IMAGING_STUDIES.DESCRIPTION": "Td (adult)  5 Lf tetanus toxoid  preservative free  adsorbed"
       }
     },
     {
       $project: {
         _id: 0,
         cost: "$ENCOUNTERS.IMAGING_STUDIES.BASE_COST"
       }
     }
   ])

db.payers.findOne({"NAME": "NO\_INSURANCE"}, {"_id": 0, "PAYER\_ID": 1}).PAYER\_ID =&gt; uuid
db.expenses.aggregate([
{
$match: {
"PAYER\_REF": uuid,
"HEALTHCARE\_EXPENSES": { $gt: 0 },
"INSURANCE\_COSTS": { $gt: 0 }
}
},
{
$group: {
\_id: null,
count: { $sum: 1 }
}
}
])

db.CLAIMS.aggregate([
     {
       $unwind: "$CLAIM_TRANSACTIONS"
     },
     {
       $match: {
         "CLAIM_TRANSACTIONS.PROCEDURE_CODE": "Acetaminophen 300 MG / Hydrocodone Bitartrate 5 MG Oral Tablet",
         "CLAIM_TRANSACTIONS.TYPE": "payment"
       }
     },
     {
       $group: {
         _id: "$CLAIM_TRANSACTIONS.PAYER_INSURANCE_REF",
         totalPaid: { $sum: "$CLAIM_TRANSACTIONS.AMOUNT" }
       }
     }
   ])

db.payers.find({"PAYER_ID": "d18ef2e6-ef40-324c-be54-34a5ee865625"}, {"_id": 0, "NAME": 1})).forEach(function(payer) {
     db.CLAIMS.find({"CLAIMS.PRIMARY_PATIENT_INSURANCE_REF": payer.NAME}, {"_id": 0, "CLAIMS.CLAIM_ID": 1, "CLAIMS.PROVIDER_REF": 1, "CLAIMS.PATIENTDEPARTMENT_ID": 1}).forEach(function(claim) {
         claim.CLAIMS.forEach(function(innerClaim) {
             print(innerClaim.CLAIM_ID + " " + innerClaim.PROVIDER_REF + " " + innerClaim.PATIENTDEPARTMENT_ID);
         });
     });
 });

db.expenses.aggregate([
       { $match: { "PAYER_REF": ObjectId("26aab0cd-6aba-3e1b-ac5b-05c8867e762c"), "HEALTHCARE_EXPENSES": { $exists: true, $ne: null } } },
       { $group: { _id: null, totalCovered: { $sum: "$HEALTHCARE_EXPENSES" } } },
       { $project: { _id: 0, totalCovered: 1 } }
   ])

db.patients.aggregate([
       {
         $unwind: "$ENCOUNTERS"
       },
       {
         $lookup: {
           from: "payers",
           localField: "ENCOUNTERS.PAYER_REF",
           foreignField: "PAYER_ID",
           as: "payer"
         }
       },
       {
         $unwind: "$payer"
       },
       {
         $match: {
           "payer.NAME": "Medicare",
           "ENCOUNTERS.PAYER_COVERAGE": {
             $eq: 0
           }
         }
       },
       {
         $group: {
           _id: null,
           count: {
             $sum: 1
           }
         }
       }
     ])
